def convert(o):
    if isinstance(o, dict):
        return convert_dict(o)
    if isinstance(o, tuple):
        return convert_tuple(o)
    return o
def convert_dict(d):
    r = {}
    for k, v in d.items():
        nk=k
        if isinstance(k, tuple):
            nk=str(k)
        nv=convert(v)
        r[nk] = nv
    return r

def convert_tuple(t):
    l = []
    for i in t:
        l.append(convert(i))
    return l


